*,
*::before,
*::after {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}

body {
  font-size: 1.125rem;
  font-family: "Barlow", sans-serif;
}

ul {
  list-style-type: none;
}

a {
  text-decoration: none;
  color: $white;
}

.dn {
  display: none;
}

.hidden {
  visibility: hidden;
}

.overlay {
  position: absolute;
  top: 0;
  left: 0;
  height: 100vh;
  width: 100vw;
  backdrop-filter: blur(1px);
  background: rgba($color: $very-dark-desaturated-blue, $alpha: 0.9);
  z-index: 50;
}

.noScroll {
  overflow: hidden;
}

