.section {
  display: flex;
  flex-direction: column;
  width: 100%;

  .sect {
    width: 100%;
    height: 600px;

    @include breakpoint("desktop") {
      display: flex;
      flex-direction: row-reverse;
    }

    &__img {
      width: 100%;
      @include breakpoint("desktop") {
        flex: 1;
      }

      &1 {
        background-image: url(/src/images/mobile/image-transform.jpg);
        @include breakpoint("desktop") {
          background-image: url(/src/images/desktop/image-transform.jpg);
          background-size: cover;
          background-repeat: no-repeat;
        }
      }

      &2 {
        background-image: url(/src/images/mobile/image-stand-out.jpg);
        @include breakpoint("desktop") {
          background-image: url(/src/images/desktop/image-stand-out.jpg);
          background-size: cover;
          background-repeat: no-repeat;
        }
      }
    }

    .desc__container {
      padding: 3rem 1.5rem;
      text-align: center;
      height: auto;

      @include breakpoint("desktop") {
        padding: 0;
        flex: 1;
        display: grid;
        place-items: center;
      }

      .desc {
        @include breakpoint("desktop") {
          text-align: left;
          padding: 0 8rem;
        }

        h1 {
          font-family: "Fraunces", serif;
          font-size: 2rem;
          color: $very-dark-desaturated-blue;
          margin-bottom: 3rem;

          @include breakpoint("desktop") {
            font-size: 3rem;
          }
        }

        p {
          color: $grayish-blue;
          line-height: 1.6;
          margin-bottom: 2rem;
        }

        .learn__more {
          position: relative;
          display: inline;
          font-family: "Fraunces", serif;
          color: $very-dark-desaturated-blue;
          cursor: pointer;

          &:hover {
            &::before {
              background-color: $yellow;
            }
          }

          &::before {
            content: "";
            position: absolute;
            left: -3px;
            right: 0;
            margin: auto;
            top: 14px;
            display: flex;
            height: 6px;
            width: 7rem;
            background-color: rgb(238, 238, 180);
            border-radius: 4px;
            z-index: -1;
          }

          &__2 {
            &::before {
              background-color: #fdb1a7;
            }

            &:hover {
              &::before {
                background-color: $soft-red;
              }
            }
          }
        }
      }
    }
  }

  .services {
    display: flex;
    flex-direction: column;
    height: auto;

    @include breakpoint("desktop") {
      flex-direction: row;
    }

    .service {
      height: 600px;
      background-size: cover;
      text-align: center;

      @include breakpoint("desktop") {
        flex: 1;
        height: 640px;
      }

      &__1 {
        background-image: url(/src/images/mobile/image-graphic-design.jpg);
        color: $dark-desaturated-cyan;

        @include breakpoint("desktop") {
          background-image: url(/src/images/desktop/image-graphic-design.jpg);
        }
      }

      &__2 {
        background-image: url(/src/images/mobile/image-photography.jpg);
        color: $dark-blue;

        @include breakpoint("desktop") {
          background-image: url(/src/images/desktop/image-photography.jpg);
        }
      }

      .content {
        margin-top: 24rem;
        padding: 1rem;

        @include breakpoint("desktop") {
          margin-top: 25rem;
        }

        h3 {
          font-family: "Fraunces", serif;
          font-size: 2rem;
          margin-bottom: 1rem;
        }
        p {
          font-size: 1rem;
          line-height: 1.5;

          @include breakpoint("desktop") {
            padding: 1rem 10rem;
            font-size: 1.125rem;
          }
        }
      }
    }
  }

  .reverse {
    @include breakpoint("desktop") {
      flex-direction: row;
    }
  }
}

